import React from 'react';
import './App.css';
import {monteCarlo} from "./service/MonteCarloService";
import {MonteCarlo} from "./components/MonteCarlo";

function App() {
  return (
    <div className="App">

      <label htmlFor="nPoints">Number of points to calculate PI:</label>
      <input type="number" id="nPoints" name="nPoints" min="2" />
      <button onClick={() => { monteCarlo(100000000).then(r => console.log(r))}}>Calculate</button>

      <MonteCarlo></MonteCarlo>

    </div>
  );
}

export default App;
